import styled from 'styled-components';

const GoodsComp = styled.div`
  .container {
    width: 900px;
    height: 1200px;
    padding: 10px;
    margin: 0 auto;
    margin-top: 150px;
    border: 1px solid rgb(230, 230, 230);
    // background-color: aqua; /* ~~~~~ TEST 용 ~~~~~~ */
    table {
      width: 600px;
      margin: 0 auto;
      margin-top: 30px;
      tr {
        margin: 10px;
        td{
         margin: 10px;
        }
      }
    }
  }
`;
export default GoodsComp;
